import React, { Component } from 'react';
import bannerImg1 from "../img/banner-1.jpeg";
import bannerImg2 from "../img/banner-2.jpg";
import bannerImg3 from "../img/banner-3.jpg";

export default class Slider extends Component {
    render() {
        return (
            <div className="carousel slide" data-ride="carousel">
                <div className="carousel-inner">
                    <div className="carousel-item active">
                        <img className="max-width" src={bannerImg1} id="slideOne"></img>
                    </div>
                    <div className="carousel-item">
                        <img className="max-width" src={bannerImg2} id="slideTwo"></img>
                    </div>
                    <div className="carousel-item">
                        <img className="max-width" src={bannerImg3} id="slideThree"></img>
                    </div>
                </div>
            </div>
        )
    }
}
